import React from "react";

export const Registration_BusinessPage = () => {

    const Field_Dispenser = (type,name,id,value) => {

        return <React.Fragment>

        <div
        style={{
            width: 'inherit',

            display:'flex',
            flexDirection:'column',
            justifyContent:'space-around',

            fontFamily: '큐트신민상',
            fontSize: '4vw',
            fontWeight: 'bold',

            letterSpacing: '1vw',
            margin: '1.5vh 0vw',

            border: 'black dashed 3px'

        }}
        >

            <label htmlFor={id}
            style={{

            }}
            >
            {name.slice(0,1).toUpperCase()}{name.slice(1)}/
            </label>
            
            <input 
            type={type}
            name={name}
            id={id}
            value={value}
            style={{
                width:'inherit',
                
                margin: '1vh 0vw 1vh 0vw',
                padding: '1vh 2vw',

                borderRadius: '7px',

            }}

            ></input>

        </div>

        </React.Fragment>

    }

    return <React.Fragment>
            <div
            style={{
            width:'inherit',
            height:'inherit',
            
            display:'flex',
            flexDirection:'column',

            justifyContent:'center',
            alignItems: 'center'
            }}
            >

                <span>Registration</span>

                <div
                style={{
                    Width: '70vw',
                    backgroundColor: 'white',
                    padding: '3vh 10vw 6vh 10vw',
                    borderRadius: '15px',
                    border: 'black solid 1.5px'
                }}
                >

                    <div>
                        
                        {Field_Dispenser('text','name','name')}

                        {Field_Dispenser('email','email','email')}

                        {Field_Dispenser('text', 'ID', 'ID')}

                        {Field_Dispenser('text','password','password')}

                        {Field_Dispenser('text', 'position', 'position', 'business')}

                    </div>

                <input
                type="button"
                style={{
                    
                    width: '46.5vw',
                    // height: '3.5vh',

                    borderRadius: '10px',

                    padding: '1vh 0vw'
                }}
                value='Submit'
                >
                </input>

                </div>

            </div>

        </React.Fragment>
    

}

export default Registration_BusinessPage
